 ),
"DT_node_lookup_5" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_6", t1."Leaf_10", t1."Leaf_12", t1."Leaf_15", t1."Leaf_16", t1."Leaf_17", t1."Leaf_18", t1."Leaf_20", t1."Leaf_21", t1."Leaf_22", t1."Leaf_24", t1."Leaf_29", t1."Leaf_31", t1."Leaf_34", t1."Leaf_35", t1."Leaf_37", t1."Leaf_38", t1."Leaf_42", t1."Leaf_43", t1."Leaf_44", t1."Leaf_48", t1."Leaf_49", t1."Leaf_51", t1."Leaf_52", t1."Leaf_53", t1."Leaf_55", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_68", t1."Leaf_69", t1."Leaf_70", t1."Leaf_71", t1."Leaf_73", t1."Leaf_74", t1."Leaf_75", t1."Leaf_80", t1."Leaf_81", t1."Leaf_82", t1."Leaf_83", t1."Leaf_86", t1."Leaf_87", t1."Leaf_88", t1."Leaf_92", t1."Leaf_96", t1."Leaf_97", t1."Leaf_99", t1."Leaf_101", t1."Leaf_103", t1."Leaf_104", t1."Leaf_107", t1."Leaf_110", t1."Leaf_111", t1."Leaf_112", t1."Leaf_115", t1."Leaf_116", t1."Leaf_119", t1."Leaf_121", t1."Leaf_122", t1."Leaf_123", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
