    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_72" <= -1.518980) AND (t."X_98" <= -0.334415) AND (t."X_99" <= -0.555423)) THEN 5 ELSE NULL END AS "Leaf_5",
